import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = ({ user, onLogout }) => {
  const navigate = useNavigate();

  const handleLostItemClick = () => {
    if (user) {
      navigate('/lost-item');
    } else {
      navigate('/register');
    }
  };

  const handleFoundItemClick = () => {
    if (user) {
      navigate('/found-item');
    } else {
      navigate('/register');
    }
  };

  const handleLogout = () => {
    onLogout();
    navigate('/login');
  };

  return (
    <div style={{width: '100%', height: '100%', position: 'relative', background: 'white', overflow: 'hidden'}}>
      <div style={{width: 1280, height: 146, left: 0, top: 0, position: 'absolute', background: '#03045E'}} />
      <div style={{width: 65, height: 32, left: 387, top: 64, position: 'absolute', overflow: 'hidden'}}>
        <div style={{left: 0, top: 0, position: 'absolute', color: 'white', fontSize: 26, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word'}}>Home</div>
      </div>
      {user && (
        <>
          <div style={{width: 115, height: 32, left: 532, top: 64, position: 'absolute', overflow: 'hidden', cursor: 'pointer'}} onClick={() => navigate('/matches')}>
            <div style={{left: 0, top: 0, position: 'absolute', color: 'white', fontSize: 26, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word'}}>My Report</div>
          </div>
          <div style={{padding: 10, left: 727, top: 54, position: 'absolute', overflow: 'hidden', justifyContent: 'center', alignItems: 'center', gap: 10, display: 'inline-flex', cursor: 'pointer'}}>
            <div style={{color: 'white', fontSize: 26, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word'}}>Notification</div>
          </div>
          <div style={{padding: 10, left: 955, top: 54, position: 'absolute', overflow: 'hidden', justifyContent: 'center', alignItems: 'center', gap: 10, display: 'inline-flex', cursor: 'pointer'}}>
            <div style={{color: 'white', fontSize: 26, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word'}}>Profile</div>
          </div>
        </>
      )}
      <div style={{padding: 10, left: 448, top: 770, position: 'absolute', overflow: 'hidden', justifyContent: 'center', alignItems: 'center', gap: 10, display: 'inline-flex'}}>
        <div style={{color: 'rgba(0, 0, 0, 0.60)', fontSize: 26, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word'}}>About Us</div>
      </div>
      <div style={{width: 220, height: 220, left: 48, top: 54, position: 'absolute', background: 'white', borderRadius: 9999}} />
      <img style={{width: 220, height: 220, left: 48, top: 54, position: 'absolute', objectFit: 'cover', objectPosition: 'center', borderRadius: 9999}} src="image/logo2_1.png" />
      <div style={{left: 48, top: 364, position: 'absolute', color: 'black', fontSize: 40, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word'}}>Welcome back to Back2U</div>
      <div style={{width: 413, left: 93, top: 449, position: 'absolute', color: 'black', fontSize: 28, fontFamily: 'Calibri', fontWeight: '400', wordWrap: 'break-word'}}>Lost or found something ?<br/>Let's get it back to the right hands</div>
      <div style={{width: 158, height: 32, left: 610, top: 780, position: 'absolute', overflow: 'hidden'}}>
        <div style={{left: 0, top: 0, position: 'absolute', color: 'rgba(0, 0, 0, 0.60)', fontSize: 26, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word'}}>Contact Us</div>
      </div>
      {user ? (
        <div style={{width: 89, height: 34, left: 1126, top: 63, position: 'absolute', overflow: 'hidden', cursor: 'pointer'}} onClick={handleLogout}>
          <div style={{left: 0, top: 0, position: 'absolute', color: 'white', fontSize: 26, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word'}}>Log Out</div>
        </div>
      ) : (
        <div style={{width: 89, height: 34, left: 1126, top: 63, position: 'absolute', overflow: 'hidden', cursor: 'pointer'}} onClick={() => navigate('/login')}>
          <div style={{left: 0, top: 0, position: 'absolute', color: 'white', fontSize: 26, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word'}}>Sign In</div>
        </div>
      )}
      <div style={{width: 1280.31, height: 0, left: -0.15, top: 725, position: 'absolute', boxShadow: '4px 4px 4px ', outline: '1px rgba(0, 0, 0, 0.50) solid', outlineOffset: '-0.50px', filter: 'blur(2px)'}}></div>
      <div style={{width: 282, height: 309, left: 555, top: 284, position: 'absolute', opacity: 0.50, background: '#90E0EF', boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: 30, cursor: 'pointer'}} onClick={handleLostItemClick} />
      <div style={{left: 638, top: 325, position: 'absolute', color: 'black', fontSize: 32, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word', cursor: 'pointer'}} onClick={handleLostItemClick}>Lost Item</div>
      <img style={{width: 199, height: 156, left: 606, top: 353, position: 'absolute', cursor: 'pointer'}} src="https://via.placeholder.com/199x156/90E0EF/000000?text=Lost+Item" onClick={handleLostItemClick} />
      <div style={{left: 611, top: 535, position: 'absolute', color: 'black', fontSize: 24, fontFamily: 'Calibri', fontWeight: '400', wordWrap: 'break-word', cursor: 'pointer'}} onClick={handleLostItemClick}>Report lost item</div>
      <div style={{width: 282, height: 309, left: 911, top: 284, position: 'absolute', opacity: 0.50, background: '#90EFA5', boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: 30, cursor: 'pointer'}} onClick={handleFoundItemClick} />
      <div style={{left: 975, top: 325, position: 'absolute', color: 'black', fontSize: 30, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word', cursor: 'pointer'}} onClick={handleFoundItemClick}>Found Item</div>
      <div style={{left: 967, top: 535, position: 'absolute', color: 'black', fontSize: 24, fontFamily: 'Calibri', fontWeight: '400', wordWrap: 'break-word', cursor: 'pointer'}} onClick={handleFoundItemClick}>Report found item</div>
      <img style={{width: 199, height: 156, left: 955, top: 365, position: 'absolute', cursor: 'pointer'}} src="https://via.placeholder.com/199x156/90EFA5/000000?text=Found+Item" onClick={handleFoundItemClick} />
      <div style={{left: 870, top: 780, position: 'absolute', color: 'rgba(0, 0, 0, 0.50)', fontSize: 26, fontFamily: 'Calibri', fontWeight: '700', wordWrap: 'break-word'}}>2025 Back2U - Lost & Found system</div>
    </div>
  );
};

export default Home;
